import React, { Component } from "react";
import axios from "axios";
import "./Dashboard.css";
import MyTable from "./MyTable";

import { Link, Redirect } from "react-router-dom";

export default class Dashboard extends Component {
  constructor(props) {
    // if (localStorage.setItem("token", this.state.loginParams.user_id)) {
    // }
    super(props);
    this.state = {
      memeResponse: [],
      islogout: false,
    };

    this.handleChange = this.handleChange.bind(this);
    this.signOut = this.signOut.bind(this);
  }

  componentDidMount() {
    const url = "https://api.imgflip.com/get_memes";
    axios.get(url).then((response) => {
      //console.log('hi', response.data.data)
      this.setState({ memeResponse: response.data.data.memes });
    });
  }

  handleChange(event) {
    console.log(event.target.value);
  }

  signOut() {
    this.setState({
      islogout: true,
    });
    localStorage.removeItem("token");
    localStorage.removeItem("username");
  }

  render() {
    //Checklist there, on
    if (!localStorage.getItem("token")) {
      return <Redirect to="/" />;
    } else if (this.state.islogout) {
      return <Redirect to="/" />;
    }
    return (
      <div className="dash">
        <div className="dashboard grid-container col-3">awodk</div>
      </div>
    );
  }
}
